// htmlspecialchars 效果
function htmlspecialchars(str) {
	var s = "";
	if (str.length == 0) return "";
	for (var i = 0; i < str.length; i++) {
		switch (str.substr(i, 1)) {
			case "<":
				s += "&lt;";
				break;
			case ">":
				s += "&gt;";
				break;
			case "&":
				s += "&amp;";
				break;
			case " ":
				if (str.substr(i + 1, 1) == " ") {
					s += " &nbsp;";
					i++;
				} else s += " ";
				break;
			case "\"":
				s += "&quot;";
				break;
			case "\n":
				s += "<br>";
				break;
			default:
				s += str.substr(i, 1);
				break;
		}
	}
	return s;
}

// sprintf 效果
if (!String.prototype.format) {
	String.prototype.format = function() {
		var args = arguments;
		return this.replace(/{(\d+)}/g, function(match, number) {
			return typeof args[number] != 'undefined' ? args[number] : match;
		});
	};
}

// byte 转 SIZE
function bytesToSize(bytes) {
	if (bytes === 0) return '0 B';
	var k = 1024;
	sizes = ['B', 'KB', 'MB', 'GB', 'TB', 'PB', 'EB', 'ZB', 'YB'];
	i = Math.floor(Math.log(bytes) / Math.log(k));
	return (bytes / Math.pow(k, i)).toPrecision(3) + ' ' + sizes[i];
}
//求两个数的百分比
function percentage(number1, number2) {
	return (Math.round(number1 / number2 * 10000) / 100.00 + "%"); // 小数点后两位百分比
}


//JS 操作 URL 函数使用
function objURL(url) {
	var ourl = url || window.location.href;
	var href = ""; //?前面部分
	var params = {}; //url参数对象
	var jing = ""; //#及后面部分
	var init = function() {
		var str = ourl;
		var index = str.indexOf("#");
		if (index > 0) {
			jing = str.substr(index);
			str = str.substring(0, index);
		}
		index = str.indexOf("?");
		if (index > 0) {
			href = str.substring(0, index);
			str = str.substr(index + 1);
			var parts = str.split("&");
			for (var i = 0; i < parts.length; i++) {
				var kv = parts[i].split("=");
				params[kv[0]] = kv[1];
			}
		} else {
			href = ourl;
			params = {};
		}
	};
	this.set = function(key, val) {
		params[key] = encodeURIComponent(val);
	};
	this.remove = function(key) {
		if (key in params) params[key] = undefined;
	};
	this.get = function(key) {
		return params[key];
	};
	this.url = function(key) {
		var strurl = href;
		var objps = [];
		for (var k in params) {
			if (params[k]) {
				objps.push(k + "=" + params[k]);
			}
		}
		if (objps.length > 0) {
			strurl += "?" + objps.join("&");
		}
		if (jing.length > 0) {
			strurl += jing;
		}
		return strurl;
	};
	this.debug = function() {
		// 以下调试代码自由设置
		var objps = [];
		for (var k in params) {
			objps.push(k + "=" + params[k]);
		}
		alert(objps); //输出params的所有值
	};
	init();
}


/**
 * 指定数字指定时间 进行动画
 * @return {[type]}         [description]
 * @group  指定数字指定时间 进行动画
 */
$.fn.countTo = function(options) {
	options = options || {};

	return $(this).each(function() {
		// set options for current element
		var settings = $.extend({}, $.fn.countTo.defaults, {
			from: $(this).data('from'),
			to: $(this).data('to'),
			speed: $(this).data('speed'),
			refreshInterval: $(this).data('refresh-interval'),
			decimals: $(this).data('decimals')
		}, options);

		// how many times to update the value, and how much to increment the value on each update
		var loops = Math.ceil(settings.speed / settings.refreshInterval),
			increment = (settings.to - settings.from) / loops;

		// references & variables that will change with each update
		var self = this,
			$self = $(this),
			loopCount = 0,
			value = settings.from,
			data = $self.data('countTo') || {};

		$self.data('countTo', data);

		// if an existing interval can be found, clear it first
		if (data.interval) {
			clearInterval(data.interval);
		}
		data.interval = setInterval(updateTimer, settings.refreshInterval);

		// initialize the element with the starting value
		render(value);

		function updateTimer() {
			value += increment;
			loopCount++;

			render(value);

			if (typeof(settings.onUpdate) == 'function') {
				settings.onUpdate.call(self, value);
			}

			if (loopCount >= loops) {
				// remove the interval
				$self.removeData('countTo');
				clearInterval(data.interval);
				value = settings.to;

				if (typeof(settings.onComplete) == 'function') {
					settings.onComplete.call(self, value);
				}
			}
		}

		function render(value) {
			var formattedValue = settings.formatter.call(self, value, settings);
			$self.html(formattedValue);
		}
	});
};

$.fn.countTo.defaults = {
	from: 0, // the number the element should start at
	to: 0, // the number the element should end at
	speed: 1000, // how long it should take to count between the target numbers
	refreshInterval: 100, // how often the element should be updated
	decimals: 0, // the number of decimal places to show
	formatter: formatter, // handler for formatting the value before rendering
	onUpdate: null, // callback method for every time the element is updated
	onComplete: null // callback method for when the element finishes updating
};

function formatter(value, settings) {
	return value.toFixed(settings.decimals);
}



// custom formatting example
$('.digitalDetailsView').data('countToOptions', {
	formatter: function(value, options) {
		return value.toFixed(options.decimals).replace(/\B(?=(?:\d{3})+(?!\d))/g, ',');
	}
});

// start all the timers
$('.timer').each(count);

function count(options) {
	var $this = $(this);
	options = $.extend({}, options || {}, $this.data('countToOptions') || {});
	$this.countTo(options);
}
