//初始化菜单
function initSelectedMenu() {
	var index = 1;
	$('.m_l li a').each(function() {
		if ($($(this))[0].href == String(window.location)) {
			$(this).parent().addClass('online');
			index = 0;
		}
	});
	var strUrl = window.location.pathname;
	var arrUrl = strUrl.split("/");
	var strPage = arrUrl[arrUrl.length - 1];
	//判断是否是订单详情页面  特别设置
	if (strPage == "m-orderdetails") {
		$("#Default").parent().addClass("online");
	}
	if (strPage == "m-transactiondetails") {
		$("#transactiondetails").parent().addClass("online");
	}
	if (strPage == "m-order") {
		$("#order-list").parent().addClass("online");
	}


	//资讯页面选中
	$('.samenu li a').each(function() {
		$curMenu = $("#cmenu").val();
		$curUrl = $($(this))[0].href;
		$num = $curUrl.indexOf($curMenu);
		if ($num > 0) {
			$(this).parent().addClass('on');
			index = 0;
		}
	});

	//资讯页面子类选中
	$('.inHd li a').each(function() {
		$subcatMenu = $("#subcat").val();
		if ($subcatMenu != "subcat=") {
			$curUrl = $($(this))[0].href;
			$num = $curUrl.indexOf($subcatMenu);
			if ($num > 0) {
				$(this).parent().addClass('on').append('');
				index = 0;
			}
		}
	});

	//page slider for page
	jQuery(".CarouselSlide").slide({
		mainCell: ".bd ul",
		autoPlay: true,
		trigger: "click"
	});


};


//页面收藏
function bookmark() {
	var title = document.title
	var url = document.location.href
	if (window.sidebar) window.sidebar.addPanel(title, url, "");
	else if (window.opera && window.print) {
		var mbm = document.createElement('a');
		mbm.setAttribute('rel', 'sidebar');
		mbm.setAttribute('href', url);
		mbm.setAttribute('title', title);
		mbm.click();
	} else if (document.all) window.external.AddFavorite(url, title);
}

//首页javascript
if ($("body").hasClass("home")) {
	(function() {
		var hotWordCtn = $('.hot-comment');
		var titleStr = KeywordConfig.title;
		var curIndex = 0;

		function showHotWord() {
			var html = titleStr;
			for (var i = curIndex; i < KeywordConfig.num + curIndex; i++) {
				if (KeywordConfig.data[i]) {
					html += '<span class="comment-name">' + KeywordConfig.data[i].name + '：</span><span>' + KeywordConfig.data[i].comment + '</span>';
				}
			}
			hotWordCtn.empty().append(html);

			curIndex += KeywordConfig.num;
			if (curIndex >= KeywordConfig.data.length) {
				curIndex = 0;
			}

			var children = hotWordCtn.children();
			for (var i = 0; i < children.length; i++) {
				$(children[i]).delay(100 * i).animate({
					opacity: 0.1
				}, 200, function() {
					$(this).animate({
						opacity: 1
					}, 200);
				});
			}

			showHotWord.timeout = setTimeout(showHotWord, KeywordConfig.delay * 1000);
		}
		hotWordCtn.on('mouseenter', function() {
			if (showHotWord.timeout) {
				clearTimeout(showHotWord.timeout);
			}
		}).on('mouseleave', function() {
			showHotWord.timeout = setTimeout(showHotWord, KeywordConfig.delay * 1000);
		});

		if (hotWordCtn[0] && KeywordConfig) {
			showHotWord();
		}
	})();
}

//切换表单
function switch_form($op) {
	switch_active($op);
	var window_h = $(".fancybox-wrap").height();
	var w_h = $(window).height();
	var top = (w_h - window_h) / 2;
	$(".fancybox-wrap").css({
		"top": top
	});
}

//切换登录注册
function switch_active($op) {
	if ($op == "signupActive") {
		jQuery("#loginform").addClass('hidden');
		jQuery("#signupform").removeClass('hidden');
	} else {
		jQuery("#signupform").addClass('hidden');
		jQuery("#loginform").removeClass('hidden');
	}
}

